import Popup from './components/Popup';
import './App.css';

function App() {
  return (
    <div className="App">
      <main>
        <h1>React Popups</h1>
        <button
          className="btn">Open
          Popup
        </button>
        <Popup trigger={false}>
          <h3>My Popup</h3>
        </Popup>
      </main>
    </div>
  );
}

export default App;
